import './Form.css'
const Form=()=>{
const submitHandler=(event)=>{
    event.preventDefault();
    console.log("hi")
}

    return(
        <form action={submitHandler}>
            <input type="text" placeholder="username"/>
            <input type="password" placeholder="password"/>
            <input type="submit" value="submit" onClick={submitHandler}/>
        </form>
    );
}

export default Form;
